@free @Xavier75 : je viens de souscrire à une offre chez vous par téléphone. Je demande à la conseillère deux décodeurs TV supplémentaires à la souscription, on me confirme que c'est OK et on me propose même le deuxième décodeur à 4,99 € par mois et le troisième offert. Je souscris donc avec plaisir. Deux jours après, je reçois un colis avec un seul décodeur. Je téléphone alors au 3244 en demandant poliment si les deux autres sont en cours de livraison. Ma demande n'ayant pas été satisfaite, j'ai reçu un message d'un conseiller m'insultant de menteur. Donc chez @free #FREE on vous ment dès la souscription et on vous insulte après ? Tout cela a bien changé... Je vais donc résilier en utilisant mon droit de rétractation et résilier également mes lignes mobiles, étant client mobile depuis des années et admirateur de votre travail @Xavier75, je suis fortement déçu.

Merci d'avoir pris le temps de lire.

Cordialement, un client mécontent. #free #freebox @Xavier75

